            <Helmet>
                <title>{helmetTitle}</title>
            </Helmet>
            <CardContent>
                <CustomDivider
                    bColor="success.main"
                    cColor="success"
                    icon={<ForumRounded />}
                    align="center"
                    text="نظ‍رات دانشجویان دوره های من"
                />
                <CommentsSlider />
            </CardContent>
        </Card>
    );
};

